// import s from './ProfileInfo.module.css';

const ProfileStatus = (props) => {
    return (
        <div>
            <div>
                <span>{props.status}</span>
            </div>
            <div>
                <input value={props.state}/>
            </div>
        </div>
    )
}

export default ProfileStatus;
